import React from 'react';
import './styles.scss';
import Logo from "./../../assets/logo.png";


const Header = props => {
    return (
        <header className = "header">
            <div className = "wrap">
                <div className = "logo">
                    <img src = {Logo} alt="Cinema LOGO" />
                </div>
            </div>

        </header>
    );
};

export default Header;
